import { Button } from "@mui/material"
import { useState } from "react"

export interface IProps{
    id:string,
    name:string,
    staff:string,
    client:string,
    statusId:boolean

}[]


const ProjectList : React.FC<{onProps:IProps[]}>=(props)=>{


    
  
return (
    
    <div>{props.onProps.map((item:any)=>{
        
    return <Button key={item.id}> {item.name} {item.staff} {item.client} {item.statusId}</Button>

    })}</div>
    
)
}

export default ProjectList
